css:
.github-Popover.tooltip {
  max-width: 400px;
  padding-left: 10px;
  padding-right: 10px;
  box-sizing: border-box;
}
.github-Popover .tooltip-inner.tooltip-inner {
  padding: 5px;
  background-color: hsl(230, 1%, 92%);
  border: 1px solid hsl(230, 1%, 86%);
  box-shadow: 0 4px 8px hsla(0, 0%, 0%, 0.1);
  color: hsl(230, 1%, 26%);
}
.github-Popover.top .tooltip-arrow.tooltip-arrow {
  width: 10px;
  height: 10px;
  border-width: 0 0 1px 1px;
  border-color: hsl(230, 1%, 86%);
  background-color: hsl(230, 1%, 92%);
  border-bottom-right-radius: 2px;
  transform: rotate(-45deg);
}
